import { Carousel } from 'antd';
import React from "react"
export default class antdCarousel extends React.Component{
   
    render(){
        return (
          <Carousel  autoplay>
            <div>
              <h3>1</h3>
            </div>
            <div>
              <h3>2</h3>
            </div>
            <div>
              <h3>3</h3>
            </div>
            <div>
              <h3>4</h3>
            </div>
          </Carousel>
        )
            
        
    }
}
